import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
import globalMixin  from '@/assets/js/globalResizeMixin'
import { gsap } from 'gsap';
import ScrollTrigger from "gsap/ScrollTrigger"
import VueDOMPurifyHTML from 'vue-dompurify-html'
// Import Firebase SDK and its services
import firebase from 'firebase/app';
import 'firebase/database'; // Add other Firebase services you need here


const firebaseConfig = {
    apiKey: process.env.VUE_APP_API_KEY,
    authDomain: process.env.VUE_APP_AUTH_DOMAIN,
    projectId: process.env.VUE_APP_PROJECT_ID,
    databaseURL: process.env.VUE_APP_DATABASE_URL,
    storageBucket: process.env.VUE_APP_STORAGE_BUCKET,
    messagingSenderId: process.env.VUE_APP_MESSAGING_SENDER_ID,
    appId: process.env.VUE_APP_APP_ID,
};

console.log(VueDOMPurifyHTML );
// firebase.initializeApp(firebaseConfig);



gsap.registerPlugin(ScrollTrigger);

//css import 
import '@/assets/scss/__reset.scss';
import '@/assets/scss/__Layouts.scss';

const app = createApp(App);
app.use(firebase)
app.use(VueDOMPurifyHTML)
app.use(router);
app.use(globalMixin);
app.config.globalProperties.$gsap = gsap;
app.mount('#app');
